import React, { Link } from "react"

class Header extends React.Component {
    render() {
        return (
            <>
                <Link to="/"></Link>
                <nav>
                    <ul>
                        <li><Link to="Home">Home</Link></li>
                    </ul>
                </nav>
                <button>+ Submit</button>
            </>
        )
    }
}

export default Header;
